(179, 'Men\'s Round Neck Black Cotton T-Shirt:', 'men-s-round-neck-black-cotton-t-shirt-', '<p style=\"margin-left:0px;\"><strong>Men\'s Round Neck Black Cotton T-Shirt:</strong></p><p style=\"margin-left:0px;\"><strong>Material:</strong> Crafted from 100% cotton, ensuring a soft and breathable feel.</p><p style=\"margin-left:0px;\"><strong>Color:</strong> Timeless black, offering versatility and a sleek aesthetic.</p><p style=\"margin-left:0px;\"><strong>Design:</strong> Featuring a classic round neck and short sleeves for a casual and comfortable fit.</p><p style=\"margin-left:0px;\"><strong>Fit:</strong> Available in various fits like regular, slim, or athletic to suit individual preferences.</p><p style=\"margin-left:0px;\"><strong>Versatility:</strong> A wardrobe essential that pairs effortlessly with jeans, shorts, or layered under different outfits.</p><p style=\"margin-left:0px;\"><strong>Care Instructions:</strong> Maintain quality by following recommended care instructions, typically involving cold water wash and low heat tumble dry.</p>', 1, '', 'Material:\r\nCrafted from 100% cotton, ensuring a soft and breathable feel.\r\n\r\nColor:\r\nTimeless black, offering versatility and a sleek aesthetic.\r\n\r\nDesign:\r\nFeaturing a classic round neck and short sleeves for a casual and comfortable fit.\r\n\r\nFit:\r\nAvailable in various fits like regular, slim, or athletic to suit individual preferences.\r\n\r\nVersatility:\r\nA wardrobe essential that pairs effortlessly with jeans, shorts, or layered under different outfits.\r\n\r\nCare Instructions:\r\nMaintain quality by following recommended care instructions, typically involving cold water wash and low heat tumble dry.', '', '', 0, 'R.TSHIRT-M-BLACK', '', NULL, NULL, 2, 1.00, '', 7, 1, 1, 0, '', '', 0.00, 0, 3, 0, 0, 0.00000, 'null', '0', 1, '0', 1, '/backend/files/657fe514c88a26.png', 0, 1, NULL, '2024-01-17 06:12:17', '2024-01-24 18:09:50'),
