(181, 'Men\'s Round Neck Purple Cotton T-Shirt', 'men-s-round-neck-purple-cotton-t-shirt', '<p style=\"margin-left:0px;\"><strong>Material:</strong> Crafted from 100% cotton, ensuring a soft and breathable feel.</p><p style=\"margin-left:0px;\"><strong>Color:</strong> Timeless purple, offering versatility and a sleek aesthetic.</p><p style=\"margin-left:0px;\"><strong>Design:</strong> Featuring a classic round neck and short sleeves for a casual and comfortable fit.</p><p style=\"margin-left:0px;\"><strong>Fit:</strong> Available in various fits like regular, slim, or athletic to suit individual preferences.</p><p style=\"margin-left:0px;\"><strong>Versatility:</strong> A wardrobe essential that pairs effortlessly with jeans, shorts, or layered under different outfits.</p><p style=\"margin-left:0px;\"><strong>Care Instructions:</strong> Maintain quality by following recommended care instructions, typically involving cold water wash and low heat tumble dry.</p>', 1, '', 'Material:\r\nCrafted from 100% cotton, ensuring a soft and breathable feel.\r\n\r\nColor:\r\nTimeless black, offering versatility and a sleek aesthetic.\r\n\r\nDesign:\r\nFeaturing a classic round neck and short sleeves for a casual and comfortable fit.\r\n\r\nFit:\r\nAvailable in various fits like regular, slim, or athletic to suit individual preferences.\r\n\r\nVersatility:\r\nA wardrobe essential that pairs effortlessly with jeans, shorts, or layered under different outfits.\r\n\r\nCare Instructions:\r\nMaintain quality by following recommended care instructions, typically involving cold water wash and low heat tumble dry.', '', '', 0, 'R.T.SHIRT-M-PURPLE', '', NULL, NULL, 2, 1.00, '', 6, 1, 1, 0, '', '', 0.00, 0, 1, 0, 0, 0.00000, 'null', '0', 1, '0', 1, '/backend/files/657fe4ab6d9084.png', 1, 1, NULL, '2024-01-17 06:23:25', '2024-01-24 18:11:08'),
(182, 'Men\'s Navy Cotton Polo T-Shirt', 'men-s-navy-cotton-polo-t-shirt', '<p style=\"margin-left:0px;\"><strong>Material:</strong> Crafted from high-quality 100% cotton fabric, this Polo T-shirt provides a comfortable and breathable experience, ideal for various occasions.</p><p style=\"margin-left:0px;\"><strong>Color:</strong> In a sophisticated navy hue, the T-shirt offers a timeless and versatile look that complements a range of casual and semi-casual outfits.</p><p style=\"margin-left:0px;\"><strong>Design:</strong> The Polo T-shirt features a classic collar with a buttoned placket, offering a smart and sporty appearance. Short sleeves provide a balanced and comfortable fit.</p><p style=\"margin-left:0px;\"><strong>Fit:</strong> Designed for a comfortable and stylish fit, with options ranging from regular to slim fits. The tailored cut enhances the overall appearance, making it suitable for different body types.</p><p style=\"margin-left:0px;\"><strong>Logo and Details:</strong> Depending on the brand, you may find subtle branding details such as logos or emblems, often located on the chest or sleeve. These details add a touch of authenticity to the T-shirt.</p><p style=\"margin-left:0px;\"><strong>Versatility:</strong> Versatile enough to transition seamlessly from casual gatherings to slightly more formal occasions. Pair it with jeans, chinos, or shorts for a polished yet relaxed look.</p><p style=\"margin-left:0px;\"><strong>Care Instructions:</strong> To maintain the T-shirt\'s quality, follow the care instructions provided by the manufacturer. Typically, machine wash in cold water and tumble dry on low heat are recommended for cotton garments.</p><p style=\"margin-left:0px;\"><strong>Occasions:</strong> Suitable for a range of occasions, including weekend outings, casual Fridays, or even for a slightly more refined look during informal events.</p>', 1, '', '', '', '', 0, 'P.TSHIRT-M-NAVY', '', NULL, NULL, 2, 1.00, '', 2, 1, 1, 0, '', '', 0.00, 0, 1, 0, 0, 0.00000, 'null', '0', 1, '0', 1, '/backend/files/657fe5c56bf7a4.png', 1, 1, NULL, '2024-01-17 06:38:10', '2024-01-24 18:11:34'),
